import React from "react";

const Panel = ({ kalal = 101, style = {}, classes = [], children }) => {
  if (kalal === 11) {
    console.log(style);
  }
  return (
    <div className={`pnl-ctn`} style={style.container}>
      <div
        className={classes.reduce(
          (x, next) => x.toString() + " " + next.toString(),
          "pnl"
        )}
      >
        {children}
      </div>
    </div>
  );
};

export default Panel;
